import React from 'react';
import BaseLayout from '../components/layouts/BaseLayout';


class Index extends React.Component{
	render(){
		return(
		<BaseLayout>
		  	<h1>Welcome to Index Page</h1>	

	  	</BaseLayout>
	  	)
	}
}
export default Index;
